import styled from 'styled-components';

export const Landingsection = styled.div`
 marign:0;
 padding:0;
 height:700px;
 width:100%;
 background:#162082;
 position:relative;
`;
export const Imagewrapper = styled.div`
position:absolute;
left:1000px;
top:10px;
`;
export const Image = styled.img`

`;
